INSERT [dbo].[Medicine] ([ID_Medicine], [Medicine_Name], [ID_MedicineType], [Image], [Description], [ImageUrl], [Price]) VALUES (N'216708a5-afb6-4fee-ba32-956a602c7b53', N'SINUPRET ULTRA', N'e229a6a7-de64-414c-bb1a-be9391101ceb', , N'Sinupret® acts reliably against rhinitis as well as acute and chronic inflammations of the paranasal sinuses through its unique combination of the medicinal plants cowslip, gentian, common sorrel, elder and vervain. The thick mucus is rapidly dissolved, the swelling of the mucous membranes is reduced, you can breath freely again. Potential associated headache eases. However, Sinupret® does not only act against the unpleasant and painful symptoms of the infection, but also against the causes by combating the pathogens (viruses and bacteria).                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                          ', N'', CAST(1499 AS Decimal(18, 0)))
INSERT [dbo].[Medicine] ([ID_Medicine], [Medicine_Name], [ID_MedicineType], [Image], [Description], [ImageUrl], [Price]) VALUES (N'375f2787-cec5-4087-a53d-f8febd255ca5', N'Enterosgel 225g', N'7d843a0b-09d1-4f7d-93f0-641a12235f22', , N'ENTEROSGEL is a medicinal product - an enterosorbent - which excretes harmful substances out of the body. It is kind of "smart" sponge with pores fitting the size of molecules of harmful substances. The product does not absorb useful substances. It is important that Enterosgel is not absorbed in the mucous membrane of the gastrointestinal tract. Enterosgel passes through the digestive tract in the natural manner and adsorbs toxins, harmful bacteria and viruses; after seven hours it is excreted from the body.It helps with common digestive problems, food poisoning and hangovers etc.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                 ', N'', CAST(1200 AS Decimal(18, 0)))
INSERT [dbo].[Medicine] ([ID_Medicine], [Medicine_Name], [ID_MedicineType], [Image], [Description], [ImageUrl], [Price]) VALUES (N'49fd8fcf-1b36-41f0-b1db-7407d4bd9b3e', N'PROPOSOL SPRAY 50ML', N'aaaff437-79c6-4d03-8532-7e093d852775', , N'Proposol is a natural Spray made of propolis, glycerin, alcohol; it is a natural antiseptic and biostimulant with anti-inflammatory, antimicrobial, analgesic and antiviral properties. Proposol Spray boosts tissue regeneration. The Spray is used for oral cavity diseases (gingivitis, stomatitis, tonsillitis, tooth ache); to increase wound healing; for various skin disorders (ulcers, burns, neurodermatitis, acute herpes and otitis). Warning! Do not use Proposol Spray if you are hypersensitive or allergic to its components. Side effects. Allergic reactions and possible burning sensation. Warning! Before using any herbal products, make sure that you have full knowledge of how the herb works and any adverse reaction it may cause.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                               ', N'', CAST(12 AS Decimal(18, 0)))
INSERT [dbo].[Medicine] ([ID_Medicine], [Medicine_Name], [ID_MedicineType], [Image], [Description], [ImageUrl], [Price]) VALUES (N'8386fb8b-403b-4b8a-a510-fa2a517ef17d', N'Euphorbium', N'aaaff437-79c6-4d03-8532-7e093d852775', , N'Euphorbium, an acrid dull-yellow or brown resin, consisting of the concreted milky juice of several species of Euphorbia, cactus-like perennial plants indigenous to Morocco. It dissolves in alcohol, ether and turpentine; in water it is only slightly soluble. It consists of two or more resins and a substance euphorbone, C20H360 or C~5HI4O. Pliny the Elder states that the name of the drug was given to it in honor of Euphorbus, the physician of Juba II, king of Mauretania. In former times euphorbium was valued in medicine for its drastic, purgative and emetic properties.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                              ', N'', CAST(8 AS Decimal(18, 0)))
INSERT [dbo].[Medicine] ([ID_Medicine], [Medicine_Name], [ID_MedicineType], [Image], [Description], [ImageUrl], [Price]) VALUES (N'b49a0664-3aba-4984-beaa-00dc45859a39', N'PARACETAMOLUM', N'533eb93c-a52b-4ea8-aafc-826745426f7d', , N'Paracetamol, also known as acetaminophen or APAP, is a medication used to treat pain and fever.[9] It is typically used for mild to moderate pain.[9] There is poor evidence for fever relief in children.[10] It is often sold in combination with other ingredients such as in many cold medications.[9] In combination with opioid pain medication, paracetamol is used for more severe pain such as cancer pain and after surgery.[11] It is typically used either by mouth or rectally but is also available intravenously.[9][12] Effects last between two and four hours.[12]                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                        ', N'', CAST(35 AS Decimal(18, 0)))
INSERT [dbo].[Medicine] ([ID_Medicine], [Medicine_Name], [ID_MedicineType], [Image], [Description], [ImageUrl], [Price]) VALUES (N'b8e133a2-0b79-4faf-b4d2-6aaafbbf2a60', N'Ibuprofen 200mg', N'533eb93c-a52b-4ea8-aafc-826745426f7d', , N'Ibuprofen, from isobutylphenylpropanoic acid, is a nonsteroidal anti-inflammatory drug (NSAID) used for treating pain, fever, and inflammation.[4] This includes painful menstrual periods, migraines, and rheumatoid arthritis.[4] About 60% of people improve with any given NSAID, and it is recommended that if one does not work then another should be tried.[5] It may also be used to close a patent ductus arteriosus in a premature baby. It can be used by mouth or intravenously. It typically begins working within an hour.[4]                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                ', N'', CAST(150 AS Decimal(18, 0)))
INSERT [dbo].[Medicine] ([ID_Medicine], [Medicine_Name], [ID_MedicineType], [Image], [Description], [ImageUrl], [Price]) VALUES (N'daf01b96-707c-471f-bb8b-b6af6818ce38', N'FASTUM GEL', N'7d843a0b-09d1-4f7d-93f0-641a12235f22', , N'FASTUM GEL - MUSCLE & JOINT BACK PAIN RELIEVE GEL This is a colourless, non-greasy, non-staining gel with an aromatic fragrance for cutaneous use - Other ingredients|: Carbomer 940, Ethanol, Neroli essence, Lavender essence, Trolamine, Purified water Therapeutic indications For local relief of pain and inflammation associated with rheumatic and muscular disorders and soft tissue injuries such as acute strains and sprains. Pharmacodynamic properties Pharmacotherapeutic category: non-steroid anti-inflammatory drug for topical use. It has anti-inflammatory and analgesic actions.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                      ', N'', CAST(125 AS Decimal(18, 0)))
INSERT [dbo].[Medicine] ([ID_Medicine], [Medicine_Name], [ID_MedicineType], [Image], [Description], [ImageUrl], [Price]) VALUES (N'eb4dd399-ee4b-46e3-b6de-ff372a4cac7e', N'Insulin ', N'd1d9a75a-3d79-40ef-b0e3-52025c954e23', , N'Insulin (from the Latin, insula meaning island) is a peptide hormone produced by beta cells of the pancreatic islets, and by the Brockmann body in some teleost fish.[1] It has important effects on the metabolism of carbohydrates, fats and protein by promoting the absorption of, especially, glucose from the blood into fat, liver and skeletal muscle cells.[2] In these tissues the absorbed glucose is converted into either glycogen or fats (triglycerides), or, in the case of the liver, into both.[2] Glucose production by the liver is strongly inhibited by high concentrations of insulin in the blood.[3] Circulating insulin also affects the synthesis of proteins in a wide variety of tissues. In high concentrations in the blood it is therefore an anabolic hormone, promoting the conversion of small molecules in the blood into large molecules inside the cells. Low insulin levels in the blood have the opposite effect by promoting widespread catabolism.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                ', N'', CAST(547 AS Decimal(18, 0)))
